// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;
import {ERC1155} from "./ERC1155.sol";

error Unauthorized();

contract Sosh is ERC1155 {
    event Create(uint256 indexed cctId, address indexed sender, string arTxId);
    event Remove(uint256 indexed cctId, address indexed sender);
    event Trade(
        TradeType indexed tradeType,
        uint256 indexed cctId,
        address indexed sender,
        uint256 tokenAmount,
        uint256 ethAmount,
        uint256 creatorFee
    );

    struct Cct {
        uint256 id;
        string arTxId;
        address creator;
    }

    uint256 public cctIndex;
    mapping(uint256 => Cct) public ccts;
    mapping(address => uint256[]) public userccts;
    mapping(bytes32 => uint256) public txTocctId;
    mapping(uint256 => uint256) public totalSupply;
    mapping(uint256 => uint256) public pool;
    uint256 public constant CREATOR_PREMINT = 1 ether; 
    uint256 public constant CREATOR_FEE_PERCENT = 0.04 ether; 

    enum TradeType {
        Mint,
        Buy,
        Sell
    } 

    function create(string calldata arTxId) public {
        bytes32 txHash = keccak256(abi.encodePacked(arTxId));
        require(txTocctId[txHash] == 0, "cct already exists");
        uint256 newcctId = cctIndex;
        ccts[newcctId] = Cct(newcctId, arTxId, msg.sender);
        userccts[msg.sender].push(newcctId);
        txTocctId[txHash] = newcctId;
        totalSupply[newcctId] += CREATOR_PREMINT;
        cctIndex = newcctId + 1;
        _mint(msg.sender, newcctId, CREATOR_PREMINT, "");
        emit Create(newcctId, msg.sender, arTxId);
        emit Trade(TradeType.Mint, newcctId, msg.sender, CREATOR_PREMINT, 0, 0);
    }

    function remove(uint256 cctId) public {
        Cct memory cct = ccts[cctId];
        if (cct.creator != msg.sender) {
            revert Unauthorized();
        }
        delete txTocctId[keccak256(abi.encodePacked(cct.arTxId))];
        delete ccts[cctId];
        emit Remove(cctId, msg.sender);
    }

    function getcctIdsByAddress(address addr) public view returns (uint256[] memory) {
        return userccts[addr];
    }

    function _curve(uint256 x) private pure returns (uint256) {
        if (x <= 1) return 0;
        // Scaling the base and exponent to use integer arithmetic
        uint256 base = 100325; // Equivalent to 1.00325, scaled up by 100000
        uint256 baseScale = 100000; // The scale factor for the base
        uint256 result = 1 ether;

        // Exponentiation by squaring, adapted for scaled arithmetic
        for(uint256 i = 0; i < x-1; ++i) {
            result = result * base / baseScale;
        }

        return result;
    }

    function getPrice(uint256 supply, uint256 amount) public pure returns (uint256) {
        return (_curve(supply + amount) - _curve(supply)) / 1 ether / 1 ether / 50_000;
    }

    function getBuyPrice(uint256 cctId, uint256 amount) public view returns (uint256) {
        return getPrice(totalSupply[cctId], amount);
    }

    function getSellPrice(uint256 cctId, uint256 amount) public view returns (uint256) {
        return getPrice(totalSupply[cctId] - amount, amount);
    }

    function getBuyPriceAfterFee(uint256 cctId, uint256 amount) public view returns (uint256) {
        uint256 price = getBuyPrice(cctId, amount);
        uint256 creatorFee = (price * CREATOR_FEE_PERCENT) / 1 ether;
        return price + creatorFee;
    }

    function getSellPriceAfterFee(uint256 cctId, uint256 amount) public view returns (uint256) {
        uint256 price = getSellPrice(cctId, amount);
        uint256 creatorFee = (price * CREATOR_FEE_PERCENT) / 1 ether;
        return price - creatorFee;
    }

    function buy(uint256 cctId, uint256 amount) public payable {
        require(cctId < cctIndex, "cct does not exist");
        uint256 price = getBuyPrice(cctId, amount);
        uint256 creatorFee = (price * CREATOR_FEE_PERCENT) / 1 ether;
        require(msg.value >= price + creatorFee, "Insufficient payment");
        totalSupply[cctId] += amount;
        pool[cctId] += price;
        _mint(msg.sender, cctId, amount, "");
        emit Trade(TradeType.Buy, cctId, msg.sender, amount, price, creatorFee);
        (bool creatorFeeSent, ) = payable(ccts[cctId].creator).call{value: creatorFee}("");
        require(creatorFeeSent, "Failed to send Ether");
    }

    function sell(uint256 cctId, uint256 amount) public {
        require(cctId < cctIndex, "cct does not exist");
        require(balanceOf[msg.sender][cctId] >= amount, "Insufficient balance");
        uint256 supply = totalSupply[cctId];
        require(supply - amount >= CREATOR_PREMINT, "Supply not allowed below premint amount");
        uint256 price = getSellPrice(cctId, amount);
        uint256 creatorFee = (price * CREATOR_FEE_PERCENT) / 1 ether;
        _burn(msg.sender, cctId, amount);
        totalSupply[cctId] = supply - amount;
        pool[cctId] -= price;
        emit Trade(TradeType.Sell, cctId, msg.sender, amount, price, creatorFee);
        (bool sent, ) = payable(msg.sender).call{value: price - creatorFee}("");
        (bool creatorFeeSent, ) = payable(ccts[cctId].creator).call{value: creatorFee}("");
        require(sent && creatorFeeSent, "Failed to send Ether");
    }

    function uri(uint256 id) public view override returns (string memory) {
        return ccts[id].arTxId;
    }
}

